import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './TestResults.css';

const TestResults = () => {
  const navigate = useNavigate();

  // Prevent any automatic API calls
  useEffect(() => {
    // Block any background API calls that might be happening
    return () => {
      // Cleanup any potential API calls
    };
  }, []);

  const handleTestResults = () => {
    // Sample data that matches our new interface design
    const sampleResult = {
      id: "test_scan_001",
      result: {
        detections: [
          {
            class_name: "20",
            feature_name: "20 Peso Bill",
            confidence: 0.793,
            bbox: [0.15, 0.12, 0.45, 0.38]
          },
          {
            class_name: "1000", 
            feature_name: "1000 Peso Bill",
            confidence: 0.772,
            bbox: [0.50, 0.15, 0.85, 0.45]
          },
          {
            class_name: "50",
            feature_name: "50 Peso Bill", 
            confidence: 0.610,
            bbox: [0.25, 0.55, 0.75, 0.85]
          }
        ],
        authentic: true,
        confidence: 0.85,
        denomination: "Mixed Denominations",
        features: {
          security_thread: true,
          watermark: true,
          microprinting: false,
          color_changing_ink: true,
          uv_features: false,
          raised_printing: true
        }
      },
      peso_scan: {
        result: {
          detections: [
            {
              class_name: "20",
              feature_name: "20 Peso Bill",
              confidence: 0.793,
              bbox: [0.15, 0.12, 0.45, 0.38]
            },
            {
              class_name: "1000", 
              feature_name: "1000 Peso Bill",
              confidence: 0.772,
              bbox: [0.50, 0.15, 0.85, 0.45]
            },
            {
              class_name: "50",
              feature_name: "50 Peso Bill", 
              confidence: 0.610,
              bbox: [0.25, 0.55, 0.75, 0.85]
            }
          ]
        }
      },
      processing_time: 2.14,
      timestamp: "2025-10-04T03:30:00Z"
    };

    const sampleImageUrl = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mP8/5+hHgAHggJ/PchI7wAAAABJRU5ErkJggg==";

    // Navigate to results page with our sample data
    navigate('/results', {
      state: {
        result: sampleResult,
        imageUrl: sampleImageUrl,
        mode: 'file',
        scanType: 'comprehensive'
      }
    });
  };

  return (
    <div className="test-results-page">
      <div className="container">
        <div className="test-header">
          <h1>Test New Results Interface</h1>
          <p>Click the button below to see the new results page design</p>
        </div>

        <div className="test-content">
          <div className="preview-card">
            <h3>New Features:</h3>
            <ul>
              <li>✅ Two-column layout with analyzed image on the left</li>
              <li>✅ Trained Model Detection Results panel</li>
              <li>✅ YOLOv8 Detected Features with confidence bars</li>
              <li>✅ Enhanced bounding boxes with labels</li>
              <li>✅ Clean, modern interface design</li>
              <li>✅ Mobile responsive layout</li>
            </ul>
          </div>

          <button onClick={handleTestResults} className="btn btn-primary btn-large">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M15 3h4a2 2 0 0 1 2 2v14a2 2 0 0 1-2 2h-4" stroke="currentColor" strokeWidth="2" fill="none"/>
              <polyline points="10,17 15,12 10,7" stroke="currentColor" strokeWidth="2" fill="none"/>
              <line x1="15" y1="12" x2="3" y2="12" stroke="currentColor" strokeWidth="2"/>
            </svg>
            View New Results Interface
          </button>
        </div>
      </div>
    </div>
  );
};

export default TestResults;
